def lcs(sequences):
 shortest_sequence = min(sequences, key=len)
 max_length = len(shortest_sequence)
 common_substring = ""
 for length in range(max_length, 0, -1):
    for x in range(max_length - length + 1):
        substring = shortest_sequence[x:x + length]
        y = all(substring in sequence for sequence in sequences)
        if y:
            common_substring = substring
            break
    if common_substring:
        break

 return common_substring

